import React from "react";

function SecondHalf(props) {
    const {data, func} = props
  return (
    <div className="secondhalf">
      <DisplayButton data={data} func={this.handleButtonClick} index={0} />
      <DisplayButton data={data} func={this.handleButtonClick} index={1} />
      <DisplayButton data={data} func={this.handleButtonClick} index={2} />
      <DisplayButton data={data} func={this.handleButtonClick} index={3} />
      <DisplayButton data={data} func={this.handleButtonClick} index={4} />
      <DisplayButton data={data} func={this.handleButtonClick} index={5} />
    </div>
  );
}

export default SecondHalf;
